PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE salaries(
Id varchar(10) primary key,
EmployeeName varchar(30),
JobTitle varchar(100),
BasePay varchar(20),
OvertimePay varchar(20),
OtherPay varchar(20),
Benefits varchar(20),
TotalPay varchar(20),
TotalPayBenefits varchar(20),
Year integer,
Status varchar(10),
fname varchar(10),
year_min integer,
year_max integer,
gender varchar(10));
COMMIT;
